import React from 'react';

function Login() {
    return (
        <div style={{padding: '2%'}}>
            <center> Login to Course Recommender </center>
            <h3>Login</h3>
            <input type='email' placeholder='Email...' id='email_field' />
            <input
                type='password'
                placeholder='Password...'
                id='password_field'
            />

            <button onclick='login()'>Login to Account</button>
        </div>
    );
}

export default Login;
